import { PageHeader, Divider, Input, Badge, Avatar } from "antd";

import { Link } from "react-router-dom";

const { Search } = Input;
export const Header = () => {
  return (
    <>
      <div className={CSS.header}>
        <Link to="/">
          <PageHeader title="Good shop" />
          <Search placeholder="input search text" style={{ width: 500 }} />
          <Badge  count={1}>
            <Avatar shape="square" size="large">
              <img
                src="./img/shopping-cart-symbol-for-e-commerce_icon-icons.com_56124.png"
                alt=""
              />
            </Avatar>
          </Badge>
          <Divider />
        </Link>
      </div>
    </>
  );
};
